function showAreaInfo(id) {
  if (!id) return false
  area = idAarr[id]
  let txt = `<h4>${area.title}</h4>`
  if (area.info) txt += `<p>${area.info}</p>`
  if (area.url)
    txt += `<div style="width: 100%; text-align: right"><a class="button-62" role="button" href="${area.url}" target="_blank">Подробнее..</a></div>`
  showIndicator(
    txt,
    getCoordinates(id).x + getCoordinates(id).width / 2,
    getCoordinates(id).y + getCoordinates(id).height / 2
  )
}

function showIndicator(htmlText, x, y, isDelay = false) {
  indicatorWindow.isDelay = isDelay
  if (indicatorWindow.show) hideIndicator()
  clearTimeout(countdown)
  $("<div>" + htmlText + "</div>").appendTo(".indicator")
  $(".indicator")
    .css({
      top: y + 50, //indicatorWindow.offset.y,
      left: x + 30, //indicatorWindow.offset.x,
    })
    .show()
  indicatorWindow.show = true
}

function hideIndicator() {
  if (indicatorWindow.show == false) return false

  indicatorWindow.show = false
  $(".indicator").html("")
  $(".indicator").hide()
}

function getCityPoint(id) {
  return cityPointsEx[id]
}

function setAriasList(id) {
  let city = getCityPoint(id)
  if (!city) return false
  areaList = [city.area]
  for (let item of city.next) {
    let nexCity = getCityPoint(item)
    areaList.push(nexCity.area)
  }
  areaHighlight()
  return areaList
}

function areaHighlight(color = mapBacklightColor) {
  for (let id of areaList) $("#" + id).css("fill", color)
}

function getTimeLineInfo(id) {
  console.log("getTimeLineInfo:", id)
  if (lastTimelineId > -1)
    for (let i = lastTimelineId; i < timeLine.length; i++)
      if (id == timeLine[i].city) {
        lastTimelineId = i
        return timeLine[i]
      }
  for (let i = 0; i < timeLine.length; i++)
    if (id == timeLine[i].city) {
      lastTimelineId = i
      return timeLine[i]
    }
}

function getCoordinates(id) {
  let rect = document.getElementById(id).getBoundingClientRect(),
    svg3 = document.getElementById("svg2"),
    rectParent = svg3.getBoundingClientRect()
  return {
    x: rect.left - rectParent.left,
    y: rect.top - rectParent.top,
    width: rect.width,
    height: rect.height,
  }
}

function showCityPointInfo(id) {
  let city = getCityPoint(id)
  if (!city) return false
  let thtml = ""

  if (id == lastCityPoint.id) {
    let item = getTimeLineInfo(city.id)
    //console.log("item", item)
    //return false
    if (item.date)
      thtml += `<h4 style="text-align: center; padding-bottom: 10px; padding-top: 10px;">${item.date}</h4>`
    thtml += `<h5>Место: ${city.name}</h5>`
    if (city.title) thtml += `<p>Название в XIX веке: ${city.title}</p>`
    if (item.info) thtml += `<p>${item.info}</p>`
    if (item.url) {
      let st = ""
      if (city.next)
        st = `<a class="button-63" role="button"  onclick="goNextPoint('${city.next}')">Продолжить путешествие</a>`
      thtml += `<div style="width: 100%; text-align: right"><a class="button-62" role="button"  onclick="clickByButton('${item.url}')">Побробнее..</a>${st}</div>`
    }
  } else {
    thtml += `<h4>${city.name}</h4>`
    if (city.title) thtml += `<p>Название в XIX веке: ${city.title}</p>`
    if (city.moreLink)
      thtml += `<div style="width: 100%; text-align: right"><a class="button-62" role="button"  href="${city.moreLink}">История города</a></div>`
  }

  showIndicator(thtml, getCoordinates(id).x, getCoordinates(id).y, true)
}

function cityMarkerActivate(id, m) {
  if (currentCityId != lastCityPoint) {
    $("#" + id).attr("r", m.active)
    $("#" + id).attr("stroke-width", m.strokeActive)
    showCityPointInfo(id)
  }
}

function cityMarkerDeactivate(id, e, m) {
  let city = getCityPoint(id)
  if (currentCityId != id) {
    $("#" + id).attr("r", m.normal)
    $("#" + id).attr("stroke-width", m.strokeNormal)
  }
}

function pointHighlighter() {
  let m = mapMarkerInZoom
  if (currentZoom == 0) m = mapMarkerNormal

  if (currentCityId) {
    $("#" + currentCityId).attr("r", m.active)
    $("#" + currentCityId).attr("stroke-width", m.strokeActive)
  }

  if (lastCityPoint.id && lastCityPoint.id != currentCityId) {
    $("#" + lastCityPoint.id).attr("r", m.normal)
    $("#" + lastCityPoint.id).attr("stroke-width", m.strokeNormal)
  }
  hideIndicator()
}

function changeMapMarkers(m, cls = ".circle5") {
  $(cls).attr("r", m.normal)
  $(cls).attr("stroke-width", m.strokeNormal)
  pointHighlighter(m)

  $(cls).hover(
    function (e) {
      cityMarkerActivate($(this).attr("id"), m)
    },
    function (e) {
      cityMarkerDeactivate($(this).attr("id"), e, m)
    }
  )
  $(".path5").attr("stroke-width", m.lineStrokeWidth)
  $(".path5").attr("stroke-dasharray", m.lineStrokeDasharray)
}
